import React from "react";
import logo from "../assets/MokxLogo.png";

const Home = () => {
  return (
    <div className="w-screen h-screen border-2 border-black flex justify-center align-items">
      <img src={logo} alt="" className="w-[10.75rem] h-[10.75rem]" />
    </div>
  );
};

export default Home;
